# *************************************************************************
# 命令说明：
#   命令1：
#       I2CADDR
#       设置I2C地址
#       例：
#           // 设置I2C地址为0x80
#           I2CADDR= 0x80
#   命令2：
#       MODE
#       设置I2C写入模式
#       支持的模式：
#           // 8位寄存器地址,8位寄存器值
#           8BITREG_BYTEWRITE
#           // 8位寄存器地址,16位寄存器值
#           8BITREG_WORDWRITE
#           // 16位寄存器地址,8位寄存器值
#           16BITREG_BYTEWRITE
#           // 16位寄存器地址,16位寄存器值
#           16BITREG_WORDWRITE
#       例：
#           // 设置I2C写入模式为16位寄存器地址,8位寄存器值
#           MODE= 16BITREG_BYTEWRITE
#   命令3：
#       REG
#       配置寄存器
#       注意：
#           该命令必须在MODE命令之后
#           该命令解析依赖于MODE命令设置的模式
#       例：
#           // 16位地址寄存器0x02BE,写入8位寄存器值0x00
#           MODE= 16BITREG_BYTEWRITE
#           REG= 0x2BE, 0x00
#   命令4：
#       BITFIELD
#       配置寄存器特定bit位
#       注意：
#           该命令必须在MODE命令之后
#           该命令解析依赖于MODE命令设置的模式
#       例：
#           // 16位地址寄存器0x3348的bit8~bit9的值写为1
#           MODE= 16BITREG_BYTEWRITE
#           BITFIELD= 0x3348, 0x0300, 0x0001
#   命令5：
#       DELAY
#       延时
#       例：
#           // 延时300ms
#           DELAY= 300
#   命令6：
#       RESOLUTION
#       设置森云相机视频采集设备输出格式及分辨率
#       支持的格式：
#           // YUYV
#           YUV422_YUYV
#           // UYVY
#           YUV422_UYVY
#           // raw8,只传输raw12数据的低8bit,只适用于森云相机视频采集设备1.0版本
#           RAWDATA_8BIT
#           // raw12
#           RAWDATA_12BIT
#       注意：
#           分辨率高hight不支持奇数值
#           RAWDATA_12BIT模式时,分辨率width*12/16的值不能为奇数
#       例：
#           // 设置YUYV输出,分辨率1280x720
#           RESOLUTION= YUV422_YUYV,1280,720
# *************************************************************************
#

